export default {
  // 对外暴露的可以设置的属性
  data() {
    return {
      crumbData: "",
    };
  },
  created() {
    this.getCrumbsData();
  },
  methods: {
    getCrumbsData() {
      let id = this.$route.params.id;
      this.crumbData = this.$store.state.tabData[id-1];
    },
    

  }
};
